import React, { useEffect, useState } from "react";
import axios from "axios";

const Navbar = () => {
  const [user, setUser] = useState(null);

  useEffect(() => {
    axios.get("https://api.example.com/user")
      .then((response) => {
        setUser(response.data);
      })
      .catch((error) => {
        console.error("Error fetching user:", error);
      });
  }, []);

    return (
  <nav className="bg-primary text-white p-4 shadow-lg">
    {user && <p>Welcome, {user.name}!</p>}
    <div className="max-w-7xl mx-auto flex justify-between items-center">
      <h1 className="text-2xl font-bold">KSM Project</h1>
    </div>
  </nav>
);
    return (
        <nav className="bg-primary text-white p-4 shadow-lg">
          <div className="max-w-7xl mx-auto flex justify-between items-center">
            <h1 className="text-2xl font-bold">KSM Project</h1>
            <button className="md:hidden" onClick={() => setIsOpen(!isOpen)}>
              {isOpen ? <X size={28} /> : <Menu size={28} />}
            </button>
            <ul className="hidden md:flex space-x-6">
              <li><a href="#" className="hover:text-secondary">Home</a></li>
              <li><a href="#" className="hover:text-secondary">Explore</a></li>
              <li><a href="#" className="hover:text-secondary">Startups</a></li>
              <li><a href="#" className="hover:text-secondary">Contact</a></li>
            </ul>
          </div>
    
          {isOpen && (
            <ul className="md:hidden flex flex-col space-y-3 mt-4 text-center">
              <li><a href="#" className="hover:text-secondary">Home</a></li>
              <li><a href="#" className="hover:text-secondary">Explore</a></li>
              <li><a href="#" className="hover:text-secondary">Startups</a></li>
              <li><a href="#" className="hover:text-secondary">Contact</a></li>
            </ul>
          )}
        </nav>
  );
};

export default Navbar;
